import React from 'react'

function RecipeTile({ recipe }) {
    return (
        recipe["recipe"]["image"].match(/\.(jpeg|jpg|gif|png)$/) 
        !== null && (
        <div onClick={ () => {
            window.open(recipe["recipe"]["url"]);
        }}>
            <img src={recipe["recipe"]["image"]} alt=""/>
            <p>{recipe["recipe"]["label"]}</p>
        </div>
        )
    );
}

export default RecipeTile
